import React from 'react';
import "./style.css";

const Footer = () => {
    return (
        <div className="Footer">
            <div className="address">
                <span className="address-text">
                    350044, Россия, г. Краснодар, ул. Калинина, 13
                </span>
            </div>
            <div className="contact">
                <a href="mailto:mail@kubsau.ru" className="contact-link">mail@kubsau.ru</a>
                <a href="tel:+78612215942" className="contact-link">+7 (861) 221-59-42</a>
            </div>
        </div>
    );
}

export default Footer;
